INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108401, 4, "カルミナ", 46, "O", 3, 163, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "人々を守るために歌う、唱喚士の少女", 0, 17, "福原綾香", 6, "各種楽器", "ヒューマン", "チカ（クリスマス）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108501, 9, "サレンディア救護院", 40, "B", 9, 150, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "泣き虫で臆病な守ってあげたい女の子", 0, 12, "植田佳奈", 6, "観劇、おままごと", "ヒューマン", "クルミ（クリスマス）");
