INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108701, 2, "トゥインクルウィッシュ", 44, "A", 27, 155, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助けが大好き！　前向き格闘娘", 0, 16, "東山奈央", 8, "人助け、応援", "獣人族", "ヒヨリ（ニューイヤー）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108801, 2, "トゥインクルウィッシュ", 47, "O", 5, 158, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "戦闘のサポートが得意な、心優しい少女", 0, 17, "種田梨沙", 4, "料理、人間観察", "ヒューマン", "ユイ（ニューイヤー）");
