INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (109201, "", "？？？", 55, "AB", 1, 156, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "英霊と契約を結んだマナリアの天才王女", 0, 17, "日笠陽子", 12, "読書", "ヒューマン", "アン");
